import React, { useReducer } from 'react';
import logo from './logo.svg';
import './App.css';
import PageLayout from './PageLayout.js'
import Home from './Home.js';

export default function App() {
  const [windows, dispatch] = useReducer(windowsReducer, ['home', 'home', 'home', 'home']);
  return (
    <PageLayout>
      {windows[0] !== "" && <div style={{
        gridArea: 'a0 / a0 / ' + windows[2] === "" ? 'a2' : 'a0' + ' / ' + windows[1] === "" ? 'a1' : 'a0'
      }}>
        {windows[0] === "home" && <Home></Home>}
      </div>}
    </PageLayout>
  );
}

function windowsReducer(windows, action) {
  switch (action.type) {
    case 'add': {
      return windows.with(action.position, action.newScreen);
    }
    case 'remove': {
      return windows.with(action.position, "");
    }
    default: {
      throw Error('Unknown action in windowsReducer: ' + action.type);
    }
  }
}
